import React from 'react';
import './App.css';
<MyButton color="blue" shadowSize={2}>
  Click Me
</MyButton>

React.createElement(
  MyButton,
  {color: 'blue', shadowSize: 2},
  'Click Me'
)

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <big>
            WELCOME
          </big>
        </p>
        <img src="/cana.png" className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
